import React from 'react';
import { ChartBarIcon } from '@heroicons/react/24/outline';

const Navbar: React.FC = () => {
  return (
    <nav className="bg-primary text-white p-4">
      <div className="container mx-auto flex items-center justify-between">
        <div className="flex items-center space-x-2">
          <ChartBarIcon className="h-8 w-8" />
          <h1 className="text-2xl font-bold">Fitness Tracker</h1>
        </div>
        <div className="flex space-x-4">
          <button className="hover:text-accent transition-colors">Dashboard</button>
          <button className="hover:text-accent transition-colors">Workouts</button>
          <button className="hover:text-accent transition-colors">Stats</button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
